pixelsize();
var spheres = [];
var pixels;
const nameImage = new Image();
nameImage.src = 'data:image/png;base64,';

myName = document.querySelector('#name');
var c1 = myName.getContext('2d');
introButton = document.getElementById("introButton");
var h = myName.width;
var left = [0, 5*h/3];
class star {
    constructor(){
        let h = myName.height;
        let r = h/2 * Math.sqrt(Math.random());
        let theta = Math.random() * 2 * Math.PI;
        this.position = [h/2+r*Math.cos(theta), h/2+r*Math.sin(theta)]
        this.angle = 2*Math.PI*Math.random()
        this.size = (1.2+Math.random())*2*pxs
        this.currcolour = [0.0, 0.0, 0.0, 0.0]
        this.colour = [0.0, 0.0, 0.0, 0.0]
        this.speed = 0.15*pxs*(Math.random()+1)
    }
    update(){
        let h = myName.height/2;
        if ((this.position[0]-h)**2 + (this.position[1]-h)**2>=h**2){
            this.angle=(this.angle-Math.PI)%(2*Math.PI);
        }
        this.position[0]+=this.speed*Math.cos(this.angle);
        this.position[1]+=this.speed*Math.sin(this.angle);
        let num = (parseInt(this.position[1])*pixels.width+parseInt(this.position[0]))*4;
        if (pixels.data[num+3]>=1){
            this.currcolour = []
            for (let i=0; i<3; i++){
                this.currcolour.push(4/5*pixels.data[num+i]+51)
            }
            this.currcolour=[].slice.call(pixels.data.slice(num, num+4));
            this.currcolour[3]=0.7;
        } else {
            this.currcolour=[255, 255, 255, 0.2];
        }
        for (let i=0; i<4; i++){
            this.colour[i]+=((this.currcolour[i]-this.colour[i])/12);
        }
        c1.beginPath();
        c1.arc(this.position[0]-(this.size/2), this.position[1]-(this.size/2), this.size, 0, 2 * Math.PI);
        c1.fillStyle = `rgba(${this.colour[0]}, ${this.colour[1]}, ${this.colour[2]}, ${this.colour[3]})`;
        c1.fill();
    }
}

function resizeMyName(){
    if ($(window).width()>$(window).height()){
        myName.width = 0.50*$(window).height();
        myName.height = 0.50*$(window).height();
        myName.style.left = ($(window).width()-0.50*$(window).height())/2+'px';
        myName.style.top = 0.25*$(window).height()+'px';
        introButton.style.top = (0.835*$(window).height())+'px';
    } else {
        myName.width = 0.50*$(window).width();
        myName.height = 0.50*$(window).width();
        myName.style.left = 0.25*$(window).width()+'px';
        myName.style.top = ($(window).height()-0.50*$(window).width())/2+'px';
        introButton.style.top = (0.71*$(window).height()+0.125*$(window).width())+'px';
    }
    nameImage.addEventListener("load", function(){
        c1.drawImage(nameImage, left[0], 0, 5*h/3, h);
        c1.drawImage(nameImage, left[1], 0, 5*h/3, h);
        pixels = c1.getImageData(0, 0, h, h);
        spheres = [];
        for (let i=0; i<1000; i++){
            const sphere = new star()
            spheres.push(sphere);
        }
        requestAnimationFrame(nameRender);
    })
}
