function nameRender(){
    c1.clearRect(0, 0, myName.height, myName.height)
    c1.drawImage(nameImage, left[0], 0, 10*h/3, h*2);
    c1.drawImage(nameImage, left[1], 0, 10*h/3, h*2);
    left[0]-=h/1000;
    left[1]-=h/1000;
    pixels = c1.getImageData(0, 0, h*2, h*2);
    for (let i=0; i<2; i++){
        if (left[i]=0){
            left[i]=5*h/3
        }
    }
    c1.clearRect(0, 0, myName.height, myName.height)
    for (let i=0; i<spheres.length; i++){
        spheres[i].update()
    }
    setTimeout(() => {
        requestAnimationFrame(nameRender)
    }, 10);
}

